    console.log(currentName);
  };

return (
  <div>
    <form>
        <div>
         <label> Enter Your First Name </label>
         <input type='text' placeholder='Enter First name' onChange={handleNameInput}/>
        </div>
      </form>
    </div>
  );
}

export default Login;
